import React from 'react';

const HomeApp = () => {
    return (
        <div>
            <div className="logo_section" >
                <div className="container">
                    <div className="row">
                        <div className="col-sm-12">
                            <div className="logo">
                                <a href="index.html">
                                    <img src="../images/logo.png" alt="Logo" />
                                </a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default HomeApp;
